import React, { Component } from 'react';
import './App.css';
import axios from './axios-orders';
import Radium from 'radium';
import UserInput from './User_input/UserInput';
import UserOutput from './User_output/UserOutput';
import PageOne from './pages/pageOne.js'
import PageTwo from './pages/pageTwo.js'
import PageThree from './pages/pageThree.js'
import PageFour from './pages/pageFour.js'

class App extends Component {

    state = {
        political: null,
        economical: null,
        social: null,
        technological: null,
        environmental: null,
        legal: null
    };

    changeHandler = () => {
        console.log(event.target.value)
    }

    addInfoHandler = () => {
    const plan = {
        data: {
            political: "factor",
            something: "success"
        },
        result: "lol"
    }




    axios.post('/businessplans.json', plan)
    console.log(this.props.bp)
    .then(response => console.log(response))
    .catch(error => console.log(error))

    }




  render() {

    const businessPlan = {
        external: [],
        internal: [],
    }


    return (
      <div className="App">
      <button
      onClick={() => this.addInfoHandler()}>
      ONE
      </button>
      <PageOne
      bp = {businessPlan} />
      <PageTwo
      bp = {businessPlan}
      changed = {this.changeHandler} />
      <PageThree />
      <PageFour />

      </div>
    );
  }
}

export default Radium(App);
